# Version 1
#
# Installs CMake, VS Code, Visual Studio 2022 Community Edition (with VC++ Build Tools and .NET SDK)
# Adds Desktop shortcuts ^
# Adds cmd, Powershell, and VSCode to explorer right-click context menu
# Writes batch script for creating projects (CreateProject.bat)




Write-Output "`nSetting up dev environment...`n"




$ProgressPreference = "SilentlyContinue"




function AddToPathVar {
    param ([string]$path)

    if (-NOT ([Environment]::GetEnvironmentVariable("Path", "User").contains($path))) {

        Write-Output ("Adding `"" + $path + "`" to %PATH%...")

        if ([Environment]::GetEnvironmentVariable("Path", "User").endswith(";")) { [Environment]::SetEnvironmentVariable("Path", ([Environment]::GetEnvironmentVariable("Path", "User")) + $path + ";", "User"); }
        else { [Environment]::SetEnvironmentVariable("Path", ([Environment]::GetEnvironmentVariable("Path", "User")) + ";" + $path + ";", "User"); }
    
    } else { Write-Output ("`"" + $path + "`" already present in %PATH%") }

}


function InstallVSCodeExtensions {
    param ([string[]]$extensionIds)

    foreach ($extensionId in $extensionIds) {
        &"C:\Program Files\Microsoft VS Code\bin\code" --install-extension $extensionId
    }

}


function AddDesktopShortcut {
    param (
        [string]$ShortcutName,
        [string]$TargetPath
    )

    $WshShell = New-Object -comObject WScript.Shell
    $Shortcut = $WshShell.CreateShortcut("$env:USERPROFILE\Desktop\$ShortcutName.lnk")
    $Shortcut.TargetPath = $TargetPath
    $Shortcut.Save()

}


function AddToRightClickContextMenu {
    param (
        [string]$Name,
        [string]$IconPath,
        [string]$Command
    )

    $RegPath = ("HKCU:\Software\Classes\Directory\Background\shell\dev_" + $Name.Replace(" ", ""))
    if (-NOT (Test-Path $RegPath)) {

        Write-Output ("Adding `"" + $Name + "`" to context menu...")

        New-Item -Path $RegPath -Value $Name -Force | Out-Null
        New-ItemProperty -Path $RegPath -Name "Icon" -Value $IconPath -Force | Out-Null
        New-Item -Path ($RegPath+"\command") -Value $Command -Force | Out-Null

    } else { Write-Output ("`"" + $Name + "`" already present in context menu") }

}








# CMake
Write-Output "Downloading and installing CMake..."

$CMakeURLs = (Invoke-RestMethod https://api.github.com/repos/Kitware/CMake/releases/latest).assets.browser_download_url
$CMakeURL = ""
foreach($url in $CMakeURLs) {
    if ($url.endswith("windows-x86_64.msi")) { $CMakeURL = $url }
}

if ($CMakeURL -ne "") {
    Invoke-WebRequest $CMakeURL -OutFile "cmake.msi"
    Start-Process "cmake.msi" -ArgumentList "/passive" -Wait | Out-Null
    Wait-Process -Name "cmake" -ErrorAction SilentlyContinue
    Remove-Item "cmake.msi"
    AddToPathVar "C:\Program Files\CMake\bin"
} else { Write-Output "ERROR: Failed to find latest CMake download URL" }




# VS Code
Write-Output "Downloading and installing VS Code (+ extensions)..."

Invoke-WebRequest "https://code.visualstudio.com/sha/download?build=stable&os=win32-x64" -OutFile "vscodesetup.exe"
.\vscodesetup.exe /silent /mergetasks=!runcode
Wait-Process -Name "vscodesetup" -ErrorAction SilentlyContinue
Remove-Item "vscodesetup.exe"

InstallVSCodeExtensions ("ms-vscode.cpptools", "ms-vscode.powershell", "twxs.cmake", "ms-python.python", "ms-python.vscode-pylance", "golang.go")

