#region CreateProjectBatData
$CreateProjectBatData = @"
@echo off

IF "%1" == "" (GOTO help) ELSE (IF NOT "%2" == "" (GOTO help))
GOTO main




:help

echo:
echo Usage:
echo:
echo "%~n0 <PROJECT_NAME>"
echo:

exit /B




:error_ProjectExists

echo:
echo ERROR: Project "%1" already exists.
echo:

exit /B




:main

IF EXIST %1 GOTO error_ProjectExists

::    --- Create Project <PROJECT_NAME> ---
echo:
echo Creating project "%1"...




mkdir "%1\src"


:: Write src\main.cpp
echo #include ^<iostream^>>"%1\src\main.cpp"
echo int main(){ std::cout ^<^< "Hello World!\n\n"; system("pause"); return 0; }>>"%1\src\main.cpp"


:: Write build.bat
echo @echo off> "%1\build.bat"
echo:>> "%1\build.bat"
echo IF NOT EXIST build mkdir build>> "%1\build.bat"
echo:>> "%1\build.bat"
echo:>> "%1\build.bat"
echo cmake . -B build -G "Visual Studio 17 2022" -A x64 -Wdev -Wdeprecated --warn-uninitialized>> "%1\build.bat"
echo:>> "%1\build.bat"
echo :: Omit "--config Release" or change to "--config Debug" to build Debug config>> "%1\build.bat"
echo cmake --build build --target ALL_BUILD --config Release --parallel>> "%1\build.bat"
echo:>> "%1\build.bat"
echo:>> "%1\build.bat"
echo pause>> "%1\build.bat"
echo cls>> "%1\build.bat"


:: Write CMakeLists.txt
echo cmake_minimum_required(VERSION 3.24)> "%1\CMakeLists.txt"
echo project(%1)>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo set(CMAKE_CXX_STANDARD 20)>> "%1\CMakeLists.txt"
echo set(CMAKE_CXX_STANDARD_REQUIRED True)>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo set(SRC_FILES "src/main.cpp")>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo if(MSVC)>> "%1\CMakeLists.txt"
echo     add_compile_options(/O2 /Ot /arch:AVX /GA /GL /Gw /Gy /jumptablerdata /fp:fast /Qpar /MT /std:c++20 /cgthreads8 /nologo /Y- /WL /diagnostics:caret /W4)>> "%1\CMakeLists.txt"
echo     add_link_options(/INCREMENTAL:NO /IGNOREIDL /LTCG /MACHINE:X64)>> "%1\CMakeLists.txt"
echo endif()>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo:>> "%1\CMakeLists.txt"
echo add_executable(`${PROJECT_NAME} `${SRC_FILES}) # WIN32 == "LINK.exe /SUBSYSTEM:WINDOWS">> "%1\CMakeLists.txt"




echo Done!
echo:
::    -------------------------------------
"@
#endregion

